css:
.atom-text-editor,
:host {
  background-color: #0e1112;
  color: #babebd;
}
.atom-text-editor,
:host {
  background-color: #0e1112;
  color: #babebd;
}
.atom-text-editor .wrap-guide,
:host .wrap-guide {
  background: rgba(245, 250, 255, 0.04);
}
.atom-text-editor .indent-guide,
:host .indent-guide {
  color: rgba(245, 250, 255, 0.04);
}
.atom-text-editor .invisible-character,
:host .invisible-character {
  color: rgba(255, 255, 255, 0.1);
}
.atom-text-editor .gutter,
:host .gutter {
  background-color: #090b0d;
  color: #4d5a5e;
}
.atom-text-editor .gutter .line-number,
:host .gutter .line-number {
  background: #090b0d;
  color: #4d5a5e;
  padding-left: 10px;
}
.atom-text-editor .gutter .line-number.cursor-line,
:host .gutter .line-number.cursor-line {
  background-color: #0e1112;
  color: #519aba;
  font-weight: 100;
}
.atom-text-editor .gutter .line-number.cursor-line-no-selection,
:host .gutter .line-number.cursor-line-no-selection {
  background-color: #0e1112 !important;
  color: #519aba;
}
.atom-text-editor .gutter .line-number:hover,
:host .gutter .line-number:hover {
  background-color: #090b0d !important;
  color: #519aba;
}
.atom-text-editor .gutter .line-number.folded,
:host .gutter .line-number.folded,
.atom-text-editor .gutter .line-number:after,
:host .gutter .line-number:after,
.atom-text-editor .fold-marker:after,
:host .fold-marker:after {
  color: #FFF;
  background: #4d5a5e;
}
.atom-text-editor .invisible,
:host .invisible {
  color: rgba(255, 255, 255, 0.1);
}
.atom-text-editor .cursor,
:host .cursor {
  border-color: #babebd !important;
  border-left: solid 2px;
}
.atom-text-editor .selection .region,
:host .selection .region {
  background-color: #1d5b91;
}
.atom-text-editor .scroll-view,
:host .scroll-view {
  padding-left: 10px;
}
.atom-text-editor .line.cursor-line,
:host .line.cursor-line {
  background: rgba(0, 0, 0, 0.2) !important;
}
.bracket-matcher .region {
  border-bottom: 1px solid #519aba;
  margin-top: 2px;
}
atom-text-editor[mini] .scroll-view,
:host(.mini) .scroll-view {
  padding-left: 1px;
}
.text {
  color: #babebd;
}
.complete_tag {
  color: #7494a3;
}
.comment {
  color: #4d5a5e;
  background: none;
}
.constant {
  color: #a074c4;
}
.constant.character.escape {
  color: #a074c4;
}
.constant.name.attribute.tag {
  color: #519aba;
}
.constant.numeric {
  color: #a074c4;
}
.constant.other.color {
  color: #a074c4;
}
.constant.other.symbol {
  color: #a074c4;
}
.entity {
  color: #cbcb41;
}
.entity.name.class,
.entity.name.type.class {
  color: #a074c4;
}
.entity.name.function {
  color: #cbcb41;
}
.entity.name.section {
  color: #cbcb41;
}
.entity.name.tag {
  color: #519aba;
  text-decoration: none;
}
.entity.name.tag.block,
.entity.name.tag.inline,
.entity.name.tag.name {
  color: #519aba;
}
.entity.name.tag.structure {
  color: #519aba;
}
.entity.name.tag.block {
  color: #519aba;
}
.entity.name.type {
  color: #519aba;
  text-decoration: none;
}
.entity.name.type.tag {
  color: #8dc149;
}
.entity.other.attribute-name {
  color: #8dc149;
}
.entity.other.attribute-name.id {
  color: #8dc149;
}
.entity.other.inherited-class {
  color: #cbcb41;
}
.invalid.illegal,
.invalid.deprecated {
  background: none;
  color: #cc3e44;
}
.keyword {
  color: #cc3e44;
}
.keyword.control {
  color: #8dc149;
}
.keyword.operator {
  color: #cc3e44;
}
.keyword.operator.assignment {
  color: #4d5a5e;
}
.keyword.operator.new {
  color: #7494a3;
}
.keyword.other.important {
  color: #cc3e44;
}
.keyword.other.special-method {
  color: #cc3e44;
}
.keyword.other.unit {
  color: #cc3e44;
}
.markup.bold {
  color: #babebd;
  font-weight: bold;
}
.markup.changed {
  color: #babebd;
}
.markup.deleted {
  color: #babebd;
}
.markup.heading .punctuation.definition.heading {
  color: #babebd;
}
.markup.inserted {
  color: #babebd;
}
.markup.italic {
  color: #babebd;
  font-style: italic;
}
.markup.list {
  color: #babebd;
}
.markup.quote {
  color: #9ac4d7;
}
.markup.raw.inline {
  color: #babebd;
}
.meta.link {
  color: #babebd;
}
.meta.require {
  color: #babebd;
}
.meta.brace.curly {
  color: #6b7471;
}
.meta.brace.round {
  color: #babebd;
}
.meta.control.flow {
  color: #8dc149;
}
.meta.comma {
  color: #4d5a5e;
}
.meta.selector {
  color: #4d5a5e;
}
.meta.separator {
  background-color: #4d5a5e;
  color: #4d5a5e;
}
.meta.tag {
  color: #519aba;
}
.none {
  color: #babebd;
}
.punctuation {
  color: #4d5a5e;
}
.punctuation.terminator {
  color: #4d5a5e;
}
.punctuation.separator {
  color: #4d5a5e;
}
.punctuation.definition {
  color: #4d5a5e;
}
.punctuation.definition.array {
  color: #519aba;
}
.punctuation.definition.bold {
  color: #babebd;
  font-weight: bold;
}
.punctuation.definition.comment {
  color: #4d5a5e;
}
.punctuation.definition.heading,
.punctuation.definition.identity,
.punctuation.definition.italic {
  color: #babebd;
}
.punctuation.definition.italic {
  font-style: italic;
}
.punctuation.definition.string {
  color: #519aba;
}
.punctuation.definition.string.begin,
.punctuation.definition.string.end {
  color: #9ac4d7;
}
.punctuation.definition.variable {
  color: #7494a3;
}
.punctuation.definition.parameters {
  color: #babebd;
}
.punctuation.definition.tag {
  color: #519aba;
}
.punctuation.section.embedded {
  color: #babebd;
}
.string {
  color: #519aba;
}
.string .constant {
  color: #a074c4;
}
.string.interpolated {
  color: #7494a3;
}
.string.regexp {
  color: #519aba;
}
.string.regexp .constant.character.escape,
.string.regexp .source.ruby.embedded,
.string.regexp .string.regexp.arbitrary-repitition {
  color: #519aba;
}
.string.regexp.group {
  color: #519aba;
}
.string.regexp.character-class {
  color: #519aba;
}
.string.regexp .source.ruby.embedded {
  color: #519aba;
}
.string.quoted.double {
  color: #9ac4d7;
}
.string.quoted.single {
  color: #9ac4d7;
}
.string .variable {
  color: #7494a3;
}
.string.other.link {
  color: #519aba;
}
.source {
  color: #519aba;
}
.storage {
  color: #d4d7d6;
}
.storage.modifier {
  color: #d4d7d6;
}
.storage.type.class {
  color: #d4d7d6;
}
.storage.type.function {
  color: #d4d7d6;
}
.storage.type.var {
  color: #d4d7d6;
}
.support {
  color: #a074c4;
}
.support.class {
  color: #a074c4;
}
.support.function {
  color: #cbcb41;
}
.support.function.decl {
  color: #519aba;
}
.support.constant {
  color: #a074c4;
}
.support.type.property-name {
  color: #babebd;
}
.variable {
  color: #7494a3;
}
.variable.control.import.include {
  color: #8dc149;
}
.variable.other {
  color: #cc3e44;
}
.variable.other.property {
  color: #cc3e44;
}
.variable.other.module {
  color: #a074c4;
}
.variable.other.module-alias {
  color: #519aba;
}
.variable.other.object {
  color: #8dc149;
}
.variable.parameter.function {
  color: #cbcb41;
}
.source.json .meta.structure.dictionary.json > .string.quoted.json {
  color: #519aba;
}
.source.json .meta.structure.dictionary.json > .string.quoted.json > .punctuation.string {
  color: #519aba;
}
.source.json .meta.structure.dictionary.json > .value.json > .string.quoted.json,
.source.json .meta.structure.array.json > .value.json > .string.quoted.json,
.source.json .meta.structure.dictionary.json > .value.json > .string.quoted.json > .punctuation,
.source.json .meta.structure.array.json > .value.json > .string.quoted.json > .punctuation {
  color: #babebd;
}
.source.json .meta.structure.dictionary.json > .constant.language.json,
.source.json .meta.structure.array.json > .constant.language.json {
  color: #a074c4;
}
.mustache .meta.tag.template {
  color: #519aba;
}
.mustache .meta.tag.template .entity.name.tag {
  color: #9ac4d7;
}
.source.python .class {
  color: #a074c4;
}
.source.python .support.function.magic,
.source.python .inherited-class {
  color: #93acb7;
}
.source.python .support.function.magic .support.function.builtin.python,
.source.python .inherited-class .support.function.builtin.python {
  color: #93acb7;
}
.source.python .storage,
.source.python .keyword {
  color: #d4d7d6;
}
.source.python .string {
  color: #519aba;
}
.source.python .string.block {
  color: #2f6076;
}
.source.python .string.block .keyword {
  color: #2f6076;
}
atom-text-editor .line.split-diff-added,
atom-text-editor::shadow .line.split-diff-added {
  background: #8dc149 !important;
  color: rgba(0, 0, 0, 0.5) !important;
}
atom-text-editor .line.split-diff-added .text span,
atom-text-editor::shadow .line.split-diff-added .text span,
atom-text-editor .line.split-diff-added .source span,
atom-text-editor::shadow .line.split-diff-added .source span {
  color: rgba(0, 0, 0, 0.5) !important;
}
atom-text-editor .line.split-diff-added .indent-guide,
atom-text-editor::shadow .line.split-diff-added .indent-guide {
  opacity: 0;
}
atom-text-editor .line.split-diff-removed,
atom-text-editor::shadow .line.split-diff-removed {
  background: #cc3e44 !important;
  color: rgba(255, 255, 255, 0.8) !important;
}
atom-text-editor .line.split-diff-removed .text span,
atom-text-editor::shadow .line.split-diff-removed .text span,
atom-text-editor .line.split-diff-removed .source span,
atom-text-editor::shadow .line.split-diff-removed .source span {
  color: rgba(255, 255, 255, 0.8) !important;
}
atom-text-editor .line.split-diff-removed .indent-guide,
atom-text-editor::shadow .line.split-diff-removed .indent-guide {
  opacity: 0;
}
